import { Button, Container, Grid, Pagination } from '@mui/material';
import React from 'react'
import { useSearchParams } from 'react-router-dom';
import RecipeCard from '../components/RecipeCard';
import FilterSearchBox from '../components/search/FilterSearchBox';
import { Filter } from '../types/instacook-enums';
import { RecipeThumbnail, Tag } from '../types/instacook-types';

type Props = {}

const testRecipe: RecipeThumbnail = {
  "_id": "636390af8f657fd7d78e0b72",
  "contributorUsername": "Steven",
  "title": "Classic Southern Fried Chicken",
  "content": "[[\"1 1/2 cups milk\",\"2 large eggs\",\"2 1/2 cups all-purpose flour\",\"2 tablespoons salt, plus additional for sprinkling\",\"2 teaspoons black pepper\",\"4 pounds bone-in skin-on chicken pieces\",\"Vegetable oil, for frying\"], [\"Gather the ingredients. Preheat the oven to 200 F and place a rack in a large baking pan.\",\"In a medium bowl, combine the milk and eggs. Whisk to blend well.\",\"In a large heavy-duty resealable plastic food storage bag, combine the flour, 2 tablespoons salt, and pepper. Seal and shake to combine.\",\"Dip the chicken pieces in the milk and egg mixture and let excess drip off into the bowl. Set already dipped pieces aside on a plate until you have three or four.\",\"Add the dipped chicken pieces to the bag of seasoned flour.\",\"Seal the bag and shake well to coat the chicken pieces thoroughly.\",\"Remove to a plate and repeat with the remaining chicken pieces.\",\"Heat the oil in a deep, heavy skillet to 350 F. While it's heating up, set aside a large serving plate lined with paper towels.\",\"Fry the chicken, a few pieces at a time, for about 10 minutes on each side, or until golden brown and thoroughly cooked. Be careful not to put too many chicken pieces in at once—even if they can comfortably fit—since this will dramatically drop the temperature of the oil, affecting the crispness of the final product. Note that chicken breasts will take a little less time than dark meat pieces.\",\"With a slotted spoon, move the done chicken pieces onto the paper towel-lined platter to drain. Sprinkle immediately with salt.\",\"Transfer the drained and seasoned chicken to the prepared pan with a rack. Keep warm in the preheated oven while frying subsequent batches. Depending on the size of your pan, this recipe will require about 3 to 4 batches.\"], [\"This classic recipe is made-from-scratch Southern fried chicken at its easiest. Crispy and juicy, it's sure to be a family favorite. There's also no need for a long marinade in buttermilk, so you don't have to plan ahead.\"], \"data:image/png;base64,\"]",
  "numberLike": 1,
  "tags": [
    "Chicken"
  ]
}

const numTestData = 33;
const Search = (_props: Props) => {
  const [searchParams, setSearchParams] = useSearchParams();
  const [recipes, setRecipes] = React.useState<RecipeThumbnail[]>([]);
  const [page, setPage] = React.useState<number>(1);
  const [displayedRecipes, setDisplayedRecipes] = React.useState<RecipeThumbnail[]>([]);
  const [tagIdOptions, setTagIdOptions] = React.useState<string[]>([]);
  const displayedRecipesNum = 8;

  React.useEffect(() => {
    const loadTestData = () => {
      let chickenRecipes: RecipeThumbnail[] = [];
      for (let i = 0; i < numTestData; i++) {
        chickenRecipes.push(testRecipe);
      }
      setRecipes([...chickenRecipes]);
    }

    const loadTags = async () => {
      const body = {
        query: `
          query {
            getTags {
              _id
            }
          }
        `
      }

      const res = await fetch('http://localhost:3000/graphql', {
        body: JSON.stringify(body),
        method: "POST",
        headers: {
          'Content-Type': 'application/json'
        }
      });
      const apiData = await res.json();

      if (apiData.errors) {
        throw new Error(apiData.errors[0].message);
      }

      // set tag options from api
      const tags: Tag[] = apiData.data.getTags;
      setTagIdOptions(tags.map(tag => tag._id));

    }
    loadTestData();
    loadTags();
  }, [])

  // run every time the page number changes
  React.useEffect(() => {
    const loadDisplayedRecipes = () => {
      // for 8 displayed recipes: 0-8, 8-16, 16-24, 24-32
      // = (page-1) * (number of displayed recipes) to (page) * (number of displayed recipes)
      const startRange = (page - 1) * displayedRecipesNum;
      const endRange = page * displayedRecipesNum;
      setDisplayedRecipes([...recipes.slice(startRange, endRange)]);

      searchParams.set('page', page.toString());
      setSearchParams(searchParams);
    }
    loadDisplayedRecipes();
  }, [page, recipes])


  return (
    <Container
      sx={{ backgroundColor: 'white', paddingBottom: 2, paddingTop: 2, minHeight: 'calc(100vh - 64px)' }}
    >
      {/* Filter Container */}
      <Grid container sx={{ marginBottom: 2 }}>
        {/* Filter/Sort Dropdowns */}
        <Grid item sx={{ paddingLeft: 0.5, paddingRight: 0.5 }} md={5}>
          <FilterSearchBox filterType={Filter.Tags} options={tagIdOptions} />
        </Grid>
        <Grid item sx={{ paddingLeft: 0.5, paddingRight: 0.5 }} md={5}>
          {/* <FilterSearchBox filterType="Ingredients" options={tagOptions} /> */}
        </Grid>
        <Grid item sx={{ paddingLeft: 0.5, paddingRight: 0.5 }} md={2}>
          <Button color="secondary" fullWidth variant="outlined">Sort by</Button>
        </Grid>
      </Grid>

      {/* Recipe Search Result Container */}
      <Grid container>
        {displayedRecipes.map((recipe, idx) => (
          <Grid item md={3} sm={4} xs={6} sx={{ marginBottom: 2 }} key={idx}>
            <RecipeCard title={recipe.title} author={recipe.contributorUsername} img={JSON.parse(recipe.content)[3]} numberOfLikes={recipe.numberLike} recipeId={recipe._id} />
          </Grid>
        ))}
      </Grid>

      {/* Pagination Container */}
      <Grid container justifyContent="center" alignItems="center">
        <Grid item>
          <Pagination size="large" color="secondary" showFirstButton showLastButton count={Math.ceil(recipes.length / displayedRecipesNum)} page={page} onChange={(_e, pageNum: number) => { setPage(pageNum) }} />
        </Grid>
      </Grid>

    </Container>
  )
}

export default Search